import React, { useState } from 'react'
import project from "./dataProject"
import gitIcon from ".//Images/github.svg"
import { Icon } from '@iconify/react';
import { Link } from 'react-router-dom';
const MyProjects=()=> {
  // const[skills,setskills]=useState(0);
  return (
    <>
    <section className='-skillsection'>
      <div className='portfolio-container'>
        <p className='section-title'>My Projects</p>
        <h2 className='skill-section-heading'>My Expertise</h2>
      </div>
      <div className='skill-section-container'>
      {project.map((curElem) => {
        const{id,image,title,description,techStack,codeLink}=curElem;
        return(
          <div key={id} className="skill-section-card">
            <div className="skill-section-img">
              <img src={image} alt={title} className='skill-section-card-image'/>
            </div>
            <div className="skill-section-card-content">
              <h3 className="skill-section-title">{title}</h3>
              <p className="skill-section-description">{description}</p>
              <p >Tech Stack:<br/>{techStack}</p>
              <div className='skill-section-links'>
                <div><Icon icon="ic:baseline-link" />Live Preview</div>
                <div className='skill-section-code'>
                <Icon icon="devicon:github" />
                  View Code
                </div>
              </div>
            </div>
          </div>
        )
      })}
      </div>
    </section>
    </>
  )
}

export default MyProjects
